export default (state=[], action) => {
	switch (action.type) {
		case 'USER_INIT':
      return {omsNumber: null, birthDay: null, authorizationFlag: false};

		case 'USER_CHECK':
			return {omsNumber: null, birthDay: null, authorizationFlag: false}

		case 'USER_SUCCESS':
			return {omsNumber: action.payload[0], birthDay: action.payload[1], authorizationFlag: true};

		case 'USER_FAILURE':
			return {omsNumber: null, birthDay: null, authorizationFlag: false};

		default:
			return {...state, omsNumber: null, birthDay: null, authorizationFlag: false};
	}
};
